import './index.scss'
import LogoS from '../../assets/images/result.svg'

const Logo = () => {
  return (
    <div className="logo-container">
      <img className="solid-logo" src={LogoS} alt="logo" />
      <svg
        width="343pt"
        height="562pt"
        xmlns="http://www.w3.org/2000/svg"
        viewBox="0 0 9 11.25"
        version="1.1"

        // xml:space="preserve"
        // style=""
        // x="0px"
        // y="0px"
        // fill-rule="evenodd"
        // clip-rule="evenodd"
        // stroke-linejoin="round"
        // stroke-miterlimit="2"
      >
        <g
          className="svg-container"
          transform="translate(0 457) scale(.1 -.1"
          fill="none"
        >
          <path d="M7,0L2,0L2,1L1,1L1,2L0,2L0,7L1,7L1,8L2,8L2,9L7,9L7,8L8,8L8,7L9,7L9,2L8,2L8,1L7,1L7,0ZM7,2L7,1L6,1L6,2L5,2L5,1L4,1L4,2L3,2L3,1L2,1L2,2L1,2L1,3L2,3L2,2L3,2L3,3L6,3L6,2L7,2ZM7,3L7,2L8,2L8,3L7,3ZM6,4L3,4L3,5L6,5L6,4ZM2,4L1,4L1,5L2,5L2,4ZM7,4L8,4L8,5L7,5L7,4ZM7,7L7,6L8,6L8,7L7,7ZM6,7L7,7L7,8L6,8L6,7ZM3,7L3,6L6,6L6,7L5,7L5,8L4,8L4,7L3,7ZM2,7L2,6L1,6L1,7L2,7ZM2,7L3,7L3,8L2,8L2,7Z" />
        </g>
      </svg>
    </div>
  )
}

export default Logo
